import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { NuevaCajaComponent } from './nueva-caja/nueva-caja.component';
import { NuevaCategoriaComponent } from './nueva-categoria/nueva-categoria.component';
import { NuevoClienteComponent } from './nuevo-cliente/nuevo-cliente.component';
import { NuevoProveedorComponent } from './nuevo-proveedor/nuevo-proveedor.component';
import { NuevoUsuarioComponent } from './nuevo-usuario/nuevo-usuario.component';

const administracionRoutes: Routes = [
  {path:'/nueva caja',component:NuevaCajaComponent},
  {path:'/nueva categoria',component:NuevaCategoriaComponent},
  {path:'/nueva proveedor',component:NuevoProveedorComponent},
  {path:'/nueva usuario',component:NuevoUsuarioComponent},
  {path:'/nueva cliente',component:NuevoClienteComponent}
]

@NgModule({
  imports: [
    RouterModule.forChild(administracionRoutes)
  ],
  exports:[
    RouterModule
  ]
})
export class AdministracionRoutingModule { }
